宜蘭城隍廟三川殿主要結構採二通三瓜疊斗式大木構架。石柱上端以木柱續接，與大通之間以「金吾」插角（雀替）做為斜撐，強化三川殿大木構架之穩定性。金吾為龍之九子之一，龍首魚身，且有翼，喜巡邏。大通與二通施以彩繪，為宜蘭知名彩繪匠師曾氏家族曾水源所繪。大通上之短柱呈疊斗狀，最下方為趖瓜筒，瓜腳較長，抓抱大通。上方各斗呈方體，層層疊疊，往上逐層略為縮小。下層趖瓜筒與柱子間之束隨則雕以鯉魚吐草狀；其於束隨則為卷草狀。

